import bisect

def test_prettiness(a, queries):

    def compbreaks(ass, breaks, pairs, offset):
        if ass[0] == ass[-1]:
            return
        m = (ass[0] + ass[-1]) // 2
        i = bisect.bisect(ass, m)
        bisect.insort(breaks, i + offset)
        pairs -= [(offset, offset + i), (offset + i, offset + len(ass))]
        if i < len(ass):
            compbreaks(ass[:i], breaks, pairs, offset)
            compbreaks(ass[i:], breaks, pairs, offset + i)

    def go(ass, pairs, prefixes, s):
        for (x, y) in pairs:
            a = prefixes[y] - prefixes[x]
            if a == s:
                return True
        return False
    n = len(a)
    ass = sorted(a)
    breaks = [0]
    pairs = [(0, n)]
    compbreaks(ass, breaks, pairs, 0)
    breaks.append(n)
    prefixes = [0]
    a_sum = 0
    for i in range(n):
        a_sum += ass[i]
        prefixes.append(a_sum)
    goods = set()
    for (x, y) in pairs:
        a_sum = prefixes[y] - prefixes[x]
        goods.add(a_sum)
    results = []
    for s in queries:
        if s in goods:
            results.append('Yes')
        else:
            results.append('No')
    return results

